import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { GoogleLogin } from '@react-oauth/google';
import axios from 'axios';
import '../styles/Login.css';

const Login = () => {
  const [loginData, setLoginData] = useState({
    email: '',
    password: '',
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setLoginData({
      ...loginData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const { email, password } = loginData;

    try {
      const endpoint = 'http://localhost:5000/api/auth/login';
      const res = await axios.post(endpoint, { email, password });
      const { token, userType } = res.data;

      if (token) {
        localStorage.setItem('token', token);
        userType === 'admin' ? navigate('/admin') : navigate('/user-home');
      } else {
        alert('Login failed: Invalid response from server.');
      }
    } catch (error) {
      console.error('Error:', error.response?.data || error.message);
      alert('Login failed: ' + (error.response?.data?.message || error.message));
    }
  };

  const handleGoogleLoginSuccess = async (response) => {
    const googleToken = response.credential;

    try {
      const res = await axios.post('http://localhost:5000/api/auth/google', {
        token: googleToken,
      });

      const { success, token, userType } = res.data;

      if (success) {
        localStorage.setItem('token', token);
        userType === 'admin' ? navigate('/admin') : navigate('/user-home');
      } else {
        alert('Google login failed.');
      }
    } catch (error) {
      console.error('Google login error:', error.response?.data || error.message);
      alert('Google login failed.');
    }
  };

  return (
    <div className="login-container">
  {/* Left Panel */}
  <div className="login-left">
    <h2 className="login-logo">COMPANY LOGO</h2>
    <h1>Welcome to...</h1>
    <p>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
      tempor incididunt ut labore et dolore magna aliqua.
    </p>
  </div>

  {/* Right Panel */}
  <div className="login-right">
    <div className="login-box">
      <h2>Login</h2>
      <p>Welcome! Login to get amazing discounts and offers only for you.</p>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>User Name</label>
          <input
            type="email"
            name="email"
            placeholder="Enter your email"
            value={loginData.email}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Password</label>
          <input
            type="password"
            name="password"
            placeholder="Enter your password"
            value={loginData.password}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-remember">
          <input type="checkbox" id="remember" />
          <label htmlFor="remember">Remember me</label>
        </div>
        <button type="submit" className="login-button">
          LOGIN
        </button>
      </form>
      <div className="google-login">
        <GoogleLogin
          onSuccess={handleGoogleLoginSuccess}
          onError={() => console.log("Google login failed")}
        />
      </div>
      <div className="login-links">
        <a href="/signup">Signup</a>
        <a href="/forgot-password">Forgot your password?</a>
      </div>
    </div>
  </div>
</div>

  );
};

export default Login;
